import styles from "./SideBarItem.module.scss";

const SideBarItem = ({ options }: any) => {
	return (
		<div className={styles.sideBarItem}>
			<div className={styles.mainItem}>{options.text}</div>
		</div>
	);
};
export default SideBarItem;
